// Load current sources configuration
const fs = require('fs');
const path = require('path');

const sourcesPath = path.join(__dirname, '../../config/sources.json');
let sourcesConfig;

try {
  sourcesConfig = JSON.parse(fs.readFileSync(sourcesPath, 'utf8'));
  console.log('âœ… Loaded sources configuration');
} catch (error) {
  console.error('âŒ Failed to load sources config:', error.message);
  return [{
    json: {
      error: 'Failed to load sources configuration',
      details: error.message,
      timestamp: new Date().toISOString()
    }
  }];
}

// Analyze current feed performance
const performanceAnalysis = {
  totalFeeds: sourcesConfig.sources.length,
  enabledFeeds: sourcesConfig.sources.filter(s => s.enabled).length,
  categoryBreakdown: {},
  underperformingFeeds: [],
  topPerformingFeeds: [],
  discoveryNeeded: false
};

// Group feeds by category and analyze performance
sourcesConfig.sources.forEach(source => {
  const category = source.metadata?.category || 'Unknown';
  if (!performanceAnalysis.categoryBreakdown[category]) {
    performanceAnalysis.categoryBreakdown[category] = {
      count: 0,
      enabled: 0,
      avgSuccessRate: 0,
      totalTrendContribution: 0
    };
  }

  performanceAnalysis.categoryBreakdown[category].count++;
  if (source.enabled) {
    performanceAnalysis.categoryBreakdown[category].enabled++;
  }

  // Analyze performance
  const perf = source.performance || {};
  const successRate = perf.successRate || 0;
  const trendContribution = perf.trendContribution || 0;

  performanceAnalysis.categoryBreakdown[category].avgSuccessRate += successRate;
  performanceAnalysis.categoryBreakdown[category].totalTrendContribution += trendContribution;

  // Identify underperforming feeds
  if (source.enabled && (successRate < 0.6 || trendContribution < 1)) {
    performanceAnalysis.underperformingFeeds.push({
      name: source.name,
      category: category,
      successRate: successRate,
      trendContribution: trendContribution,
      url: source.url
    });
  }

  // Identify top performing feeds
  if (source.enabled && successRate > 0.8 && trendContribution > 3) {
    performanceAnalysis.topPerformingFeeds.push({
      name: source.name,
      category: category,
      successRate: successRate,
      trendContribution: trendContribution,
      url: source.url
    });
  }
});

// Calculate averages
Object.keys(performanceAnalysis.categoryBreakdown).forEach(category => {
  const cat = performanceAnalysis.categoryBreakdown[category];
  if (cat.enabled > 0) {
    cat.avgSuccessRate = cat.avgSuccessRate / cat.enabled;
  }
});

// Determine if discovery is needed
const thresholds = sourcesConfig.performanceThresholds || {};
const maxFeedsPerCategory = thresholds.maxFeedsPerCategory || 8;

Object.keys(performanceAnalysis.categoryBreakdown).forEach(category => {
  const cat = performanceAnalysis.categoryBreakdown[category];
  if (cat.enabled < Math.min(3, maxFeedsPerCategory) || cat.avgSuccessRate < 0.7) {
    performanceAnalysis.discoveryNeeded = true;
  }
});

console.log('ðŸ“Š Performance Analysis:', JSON.stringify(performanceAnalysis, null, 2));

return [{
  json: {
    sourcesConfig: sourcesConfig,
    performanceAnalysis: performanceAnalysis,
    discoveryKeywords: sourcesConfig.adaptiveDiscovery?.searchKeywords || [],
    excludedDomains: sourcesConfig.adaptiveDiscovery?.excludedDomains || [],
    timestamp: new Date().toISOString()
  }
}];

// Generate search queries for new RSS feeds
const analysis = $('Analyze Current Feeds').first().json.performanceAnalysis;
const keywords = $('Analyze Current Feeds').first().json.discoveryKeywords;
const excludedDomains = $('Analyze Current Feeds').first().json.excludedDomains;

// Identify categories that need more feeds
const categoriesNeedingFeeds = [];
Object.entries(analysis.categoryBreakdown).forEach(([category, stats]) => {
  if (stats.enabled < 3 || stats.avgSuccessRate < 0.7) {
    categoriesNeedingFeeds.push({
      category: category,
      currentFeeds: stats.enabled,
      avgSuccessRate: stats.avgSuccessRate,
      priority: stats.enabled < 2 ? 'high' : 'medium'
    });
  }
});

// Generate targeted search queries
const searchQueries = [];

// Category-specific searches
categoriesNeedingFeeds.forEach(cat => {
  const categoryKeywords = {
    'Technology': ['tech', 'technology', 'innovation', 'startup', 'AI', 'artificial intelligence'],
    'Business': ['business', 'entrepreneur', 'startup', 'finance', 'investment'],
    'Marketing': ['marketing', 'advertising', 'brand', 'campaign', 'digital marketing'],
    'Creative': ['creative', 'design', 'art', 'branding', 'visual'],
    'Advertising': ['advertising', 'ad', 'campaign', 'media', 'creative'],
    'Healthcare': ['healthcare', 'medical', 'health', 'biotech', 'pharma'],
    'Finance': ['finance', 'fintech', 'banking', 'investment', 'crypto'],
    'Retail': ['retail', 'ecommerce', 'shopping', 'consumer', 'commerce'],
    'Automotive': ['automotive', 'car', 'vehicle', 'transportation', 'mobility'],
    'Gaming': ['gaming', 'game', 'esports', 'entertainment', 'interactive']
  };

  const relevantKeywords = categoryKeywords[cat.category] || [cat.category.toLowerCase()];

  relevantKeywords.forEach(keyword => {
    searchQueries.push({
      query: `${keyword} trends RSS feed`, 
      category: cat.category,
      priority: cat.priority
    });
    searchQueries.push({
      query: `${keyword} news RSS feed`, 
      category: cat.category,
      priority: cat.priority
    });
  });
});

// Add general trend discovery queries
keywords.slice(0, 8).forEach(keyword => {
  searchQueries.push({
    query: keyword,
    category: 'General',
    priority: 'medium'
  });
});

// Remove duplicates and limit
const uniqueQueries = [];
const seen = new Set();
searchQueries.forEach(query => {
  const key = query.query.toLowerCase();
  if (!seen.has(key)) {
    seen.add(key);
    uniqueQueries.push(query);
  }
});

const finalQueries = uniqueQueries.slice(0, 20); // Limit to 20 queries

console.log(`ðŸ” Generated ${finalQueries.length} search queries for ${categoriesNeedingFeeds.length} categories`);
console.log('Categories needing feeds:', categoriesNeedingFeeds.map(c => `${c.category} (${c.currentFeeds} feeds, ${(c.avgSuccessRate * 100).toFixed(1)}% success)`));

return [{
  json: {
    searchQueries: finalQueries,
    categoriesNeedingFeeds: categoriesNeedingFeeds,
    excludedDomains: excludedDomains,
    timestamp: new Date().toISOString()
  }
}];

// Simulate web search results for RSS feed discovery
// In production, this would use OpenAI's web search or similar
const searchQueries = $('Generate Search Queries').first().json.searchQueries;
const excludedDomains = $('Generate Search Queries').first().json.excludedDomains;

// Simulated search results - in real implementation, this would be web search
const simulatedResults = [
  {
