      { title: 'Ars Technica RSS', url: 'https://feeds.arstechnica.com/arstechnica/index', domain: 'arstechnica.com' }
    ]
  },
  {
    query: 'business innovation RSS',
    results: [
      { title: 'Harvard Business Review RSS', url: 'https://hbr.org/feed', domain: 'hbr.org' },
      { title: 'MIT Technology Review RSS', url: 'https://www.technologyreview.com/feed/', domain: 'technologyreview.com' },
      { title: 'Fast Company RSS', url: 'https://www.fastcompany.com/feed', domain: 'fastcompany.com' },
      { title: 'Inc. Magazine RSS', url: 'https://www.inc.com/rss.xml', domain: 'inc.com' }
    ]
  },
  {
