    results: [
      { title: 'Marketing Land RSS', url: 'https://marketingland.com/feed', domain: 'marketingland.com' },
      { title: 'Search Engine Journal RSS', url: 'https://www.searchenginejournal.com/feed/', domain: 'searchenginejournal.com' },
