    ]
  },
  {
    query: 'AI trends RSS',
    results: [
      { title: 'AI News RSS', url: 'https://artificialintelligence-news.com/feed/', domain: 'artificialintelligence-news.com' },
      { title: 'VentureBeat AI RSS', url: 'https://venturebeat.com/category/ai/feed/', domain: 'venturebeat.com' },
      { title: 'Synced AI RSS', url: 'https://syncedreview.com/feed/', domain: 'syncedreview.com' },
      { title: 'DeepAI RSS', url: 'https://deepai.org/rss.xml', domain: 'deepai.org' }
    ]
  },
  {
    query: 'startup news RSS',
    results: [
      { title: 'TechCrunch Startups RSS', url: 'https://techcrunch.com/tag/startups/feed/', domain: 'techcrunch.com' },
      { title: 'VentureBeat RSS', url: 'https://venturebeat.com/feed/', domain: 'venturebeat.com' },
      { title: 'Startup Grind RSS', url: 'https://www.startupgrind.com/feed/', domain: 'startupgrind.com' },
      { title: 'AngelList RSS', url: 'https://angel.co/feed', domain: 'angel.co' }
    ]
  }
];

// Filter out excluded domains and create candidate feeds
const candidateFeeds = [];

simulatedResults.forEach(queryResult => {
  queryResult.results.forEach(result => {
    // Check if domain is excluded
    const isExcluded = excludedDomains.some(domain => 
      result.domain.includes(domain.replace('*.', ''))
    );

    if (!isExcluded) {
      candidateFeeds.push({
        name: result.title,
        url: result.url,
        domain: result.domain,
        discoveredFrom: queryResult.query,
        category: 'Technology', // Would be determined by AI analysis
        timestamp: new Date().toISOString()
      });
    }
  });
});

// Remove duplicates based on domain
const uniqueFeeds = [];
const seenDomains = new Set();
candidateFeeds.forEach(feed => {
  if (!seenDomains.has(feed.domain)) {
    seenDomains.add(feed.domain);
    uniqueFeeds.push(feed);
  }
});

console.log(`ðŸ” Discovered ${uniqueFeeds.length} candidate RSS feeds`);
console.log('Candidate feeds:', uniqueFeeds.map(f => `${f.name} (${f.domain})`));

return [{
  json: {
    candidateFeeds: uniqueFeeds,
    searchQueries: searchQueries,
    timestamp: new Date().toISOString()
  }
}];

// Test candidate RSS feeds for validity and quality
const candidateFeeds = $('Web Search Discovery').first().json.candidateFeeds;
const currentSources = $('Analyze Current Feeds').first().json.sourcesConfig.sources;

// Simulate RSS feed testing
const testResults = [];

candidateFeeds.forEach(feed => {
  // Simulate testing each feed
  const testResult = {
    feed: feed,
    isValid: Math.random() > 0.3, // 70% success rate
    responseTime: Math.random() * 2000 + 500, // 500-2500ms
    articleCount: Math.floor(Math.random() * 20) + 5, // 5-25 articles
    lastUpdated: new Date(Date.now() - Math.random() * 7 * 24 * 60 * 60 * 1000).toISOString(), // Within last week
    quality: Math.random() * 0.5 + 0.5, // 0.5-1.0 quality score
    category: feed.category || 'Technology'
  };

  // Check if feed already exists
  const alreadyExists = currentSources.some(source => 
    source.url === feed.url || source.metadata?.discoveredAt === feed.timestamp
  );

  if (alreadyExists) {
    testResult.isValid = false;
    testResult.reason = 'Already exists in sources';
  }

  testResults.push(testResult);
});

// Filter valid feeds and sort by quality
const validFeeds = testResults
  .filter(result => result.isValid)
  .sort((a, b) => b.quality - a.quality);

console.log(`âœ… Found ${validFeeds.length} valid RSS feeds out of ${candidateFeeds.length} candidates`);
console.log('Top candidates:', validFeeds.slice(0, 5).map(f => `${f.feed.name} (${f.quality.toFixed(2)} quality)`));

return [{
  json: {
    testResults: testResults,
    validFeeds: validFeeds,
    timestamp: new Date().toISOString()
  }
}];

// Update sources configuration with new feeds and performance data
const validFeeds = $('Test Candidate Feeds').first().json.validFeeds;
const currentConfig = $('Analyze Current Feeds').first().json.sourcesConfig;
const performanceAnalysis = $('Analyze Current Feeds').first().json.performanceAnalysis;

// Create new source entries for valid feeds
const newSources = validFeeds.slice(0, 5).map(feed => ({
  name: feed.feed.name,
  type: 'rss',
  url: feed.feed.url,
  enabled: true,
  requiresAuth: false,
  performance: {
    lastChecked: new Date().toISOString(),
    successRate: 1.0, // Initial success since we just tested it
    trendContribution: 0,
    avgArticleQuality: feed.quality,
    lastSuccessfulFetch: new Date().toISOString(),
    failureCount: 0,
    totalFetches: 1
  },
  metadata: {
    category: feed.category,
    language: 'en',
    updateFrequency: 'daily',
    discoveredAt: feed.feed.timestamp,
    discoveredFrom: feed.feed.discoveredFrom,
    initialQuality: feed.quality
  }
}));

// Update existing sources with performance data
const updatedSources = currentConfig.sources.map(source => {
  // Simulate performance updates for existing sources
  const updatedPerformance = { ...source.performance };

  if (source.enabled) {
    // Simulate some performance improvement/decline
    const performanceChange = (Math.random() - 0.5) * 0.2; // Â±10% change
    updatedPerformance.successRate = Math.max(0, Math.min(1, (updatedPerformance.successRate || 0.5) + performanceChange));
    updatedPerformance.trendContribution = Math.max(0, (updatedPerformance.trendContribution || 0) + Math.floor(Math.random() * 3) - 1);
    updatedPerformance.lastChecked = new Date().toISOString();
    updatedPerformance.totalFetches = (updatedPerformance.totalFetches || 0) + 1;
  }

  return {
    ...source,
    performance: updatedPerformance
  };
});

// Disable underperforming feeds
const thresholds = currentConfig.performanceThresholds || {};
const finalSources = updatedSources.map(source => {
  const perf = source.performance || {};
  const shouldDisable = source.enabled && (
    perf.failureCount >= (thresholds.autoDisableAfterFailures || 5) ||
    perf.successRate < (thresholds.minSuccessRateToKeep || 0.6) ||
    perf.trendContribution < (thresholds.minTrendContributionToKeep || 1)
  );

  if (shouldDisable) {
    console.log(`ðŸš« Disabling underperforming feed: ${source.name} (success: ${perf.successRate}, trends: ${perf.trendContribution})`);
    return { ...source, enabled: false };
  }

  return source;
});

// Add new sources
const finalConfig = {
  ...currentConfig,
  sources: [...finalSources, ...newSources],
  adaptiveDiscovery: {
    ...currentConfig.adaptiveDiscovery,
    lastDiscoveryRun: new Date().toISOString()
  }
};

// Save updated configuration
const fs = require('fs');
const path = require('path');
const configPath = path.join(__dirname, '../../config/sources.json');

try {
  fs.writeFileSync(configPath, JSON.stringify(finalConfig, null, 2));
  console.log('âœ… Updated sources configuration saved');
} catch (error) {
  console.error('âŒ Failed to save updated config:', error.message);
}

const summary = {
  newFeedsAdded: newSources.length,
  feedsDisabled: finalSources.filter(s => !s.enabled && s.performance?.lastChecked).length,
  totalFeeds: finalConfig.sources.length,
  enabledFeeds: finalConfig.sources.filter(s => s.enabled).length,
  newFeedNames: newSources.map(s => s.name),
  disabledFeedNames: finalSources.filter(s => !s.enabled && s.performance?.lastChecked).map(s => s.name)
};

console.log('ðŸ“Š Discovery Summary:', summary);

return [{
  json: {
    updatedConfig: finalConfig,
    summary: summary,
    newFeeds: newSources,
    timestamp: new Date().toISOString()
  }
}];

// Generate discovery report
const summary = $('Update Sources Config').first().json.summary;
const performanceAnalysis = $('Analyze Current Feeds').first().json.performanceAnalysis;

const report = {
  timestamp: new Date().toISOString(),
  discoveryRun: true,
  summary: summary,
  performance: {
    totalFeeds: performanceAnalysis.totalFeeds,
    enabledFeeds: performanceAnalysis.enabledFeeds,
    underperformingCount: performanceAnalysis.underperformingFeeds.length,
    topPerformingCount: performanceAnalysis.topPerformingFeeds.length
  },
  recommendations: []
};

// Generate recommendations
if (summary.newFeedsAdded > 0) {
  report.recommendations.push(`Added ${summary.newFeedsAdded} new RSS feeds to improve coverage`);
}

if (summary.feedsDisabled > 0) {
  report.recommendations.push(`Disabled ${summary.feedsDisabled} underperforming feeds to maintain quality`);
}

if (performanceAnalysis.underperformingFeeds.length > 0) {
  report.recommendations.push(`Monitor ${performanceAnalysis.underperformingFeeds.length} feeds that are underperforming`);
}

// Category-specific recommendations
Object.entries(performanceAnalysis.categoryBreakdown).forEach(([category, stats]) => {
  if (stats.enabled < 3) {
    report.recommendations.push(`Consider adding more feeds to ${category} category (currently ${stats.enabled} feeds)`);
  }
  if (stats.avgSuccessRate < 0.7) {
    report.recommendations.push(`Improve feed quality in ${category} category (${(stats.avgSuccessRate * 100).toFixed(1)}% success rate)`);
  }
});

console.log('ðŸ“‹ Discovery Report:', JSON.stringify(report, null, 2));

return [{
  json: report
}];

// No discovery needed - generate status report
const performanceAnalysis = $('Analyze Current Feeds').first().json.performanceAnalysis;

const report = {
  timestamp: new Date().toISOString(),
  discoveryRun: false,
  reason: 'No discovery needed - current feeds performing well',
  performance: {
    totalFeeds: performanceAnalysis.totalFeeds,
    enabledFeeds: performanceAnalysis.enabledFeeds,
    underperformingCount: performanceAnalysis.underperformingFeeds.length,
    topPerformingCount: performanceAnalysis.topPerformingFeeds.length
  },
  topFeeds: performanceAnalysis.topPerformingFeeds.slice(0, 5),
  underperformingFeeds: performanceAnalysis.underperformingFeeds.slice(0, 5),
  recommendations: []
};

// Generate maintenance recommendations
if (performanceAnalysis.underperformingFeeds.length > 0) {
  report.recommendations.push(`Monitor ${performanceAnalysis.underperformingFeeds.length} underperforming feeds`);
}

Object.entries(performanceAnalysis.categoryBreakdown).forEach(([category, stats]) => {
  if (stats.avgSuccessRate < 0.8) {
    report.recommendations.push(`Optimize ${category} feeds for better success rate`);
  }
});

console.log('ðŸ“‹ Status Report:', JSON.stringify(report, null, 2));

return [{
  json: report
}];
